      SELECT ALL - ( col2 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 * - - 11 * + 6 * + col0 * + 88 NOT IN ( 73, col2, + - col2 );
  - name: tab2

outputs:
  - name: q8463.out
    data: |
